import {
	Box,
} from '@chakra-ui/react';
import React, {  } from 'react';
import { Hero } from '../components/Hero';
import { Container } from '../components/Container';
import { Main } from '../components/Main';
import { DarkModeSwitch } from '../components/DarkModeSwitch';
import { Footer } from '../components/Footer';
import BarChart from '../components/BarChart';
import {SOCIALNODEDATA} from '../data';
import SocialNodeGraph from '../components/SocialNodeGraph';
const socketIOClient = require('socket.io-client');
const ENDPOINT = 'http://localhost:3456';
interface indexProps {
    endpoint: string
    salesresponse: any
    timeresponse: number
}

class App extends React.Component {
	constructor({state}) {
        super({});
        this.state = {
            salesresponse: [],
			timeresponse: 0,
			endpoint: ENDPOINT,
		};
	}

	componentDidMount() {
		const { endpoint } = this.state;
		//Very simply connect to the socket
		const socket = socketIOClient(endpoint);
		//Listen for data on the "outgoing data" namespace and supply a callback for what to do when we get one. In this case, we set a state variable
        socket.on('FromAPI', (data) => this.setState({timeresponse: data}));
        socket.on('FromSalesData', (data) => this.setState({salesresponse: data}))

	}

	render() {
        const {timeresponse, salesresponse} = this.state;
		return (
            <Container>
                <Hero title="DEMO"/>
                <Main>
                    <Box>The date is {timeresponse}</Box>
                    <Box width="100%">
                        {!salesresponse ? (<BarChart data={{}}></BarChart>) : (<BarChart data={salesresponse}></BarChart>)}
                    </Box>
                    <Box>
                        <SocialNodeGraph nodeGraphData={SOCIALNODEDATA}></SocialNodeGraph>
                    </Box>
                </Main>
                <DarkModeSwitch></DarkModeSwitch>
                <Footer>Fancy Footer Information</Footer>
            </Container>
		);
	}
}
export default App
